import React from "react";

export default function HomePage() {
  return (
    <div className="bg-pink-50 min-h-screen flex flex-col items-center justify-center text-center px-4">
      {/* Heading */}
      <h1 className="text-4xl md:text-6xl font-bold text-pink-700 mb-4">
        Welcome to Shaila Bakes
      </h1>

      {/* Subheading */}
      <p className="text-lg md:text-xl text-gray-700 mb-8 max-w-2xl">
        Handcrafted cakes, cupcakes, and baked delights made with love and the finest ingredients. From classic treats to custom creations â€” we bake happiness!
      </p>

      {/* Call to Action Buttons */}
      <div className="space-x-4">
        <a
          href="/menu"
          className="bg-pink-600 text-white px-6 py-3 rounded-full hover:bg-pink-700 transition"
        >
          View Menu
        </a>
        <a
          href="/contact"
          className="bg-white border border-pink-600 text-pink-600 px-6 py-3 rounded-full hover:bg-pink-50 transition"
        >
          Contact Us
        </a>
      </div>
    </div>
  );
}
